import React, {Component} from 'react';
import './GetInTouch.scss';

class GetInTouch extends Component {
    render() {
        return (
            <div className="get-in-touch">
                <span className="border git-border"></span>
                <h1>GET IN TOUCH</h1>
            </div>
        );
    }
}

export default GetInTouch;
